import React from 'react';
import '../index.css';

const Header = () => {
    return (
        <header class='header'>
            <div className='header--title'>
                <h1>TOR SOLAETXE</h1>
            </div>
            <div className='header--subtitle'>
                <span><h2>--------------------------Astrology--------------------------</h2></span>
            </div>

        </header>
    )
}

export default Header
